There is limited support for pattern matching inside match expressions. Boolean values can be matched. The Boolean match expression is the replacement for an "if-then-else" in Simfony. let bit_flip: bool = match false { false => true, true => false,
}; Optional values can be matched. The Some arm introduces a variable which must be explicitly typed. let unwrap_or_default: u32 = match Some(42) { None => 0, Some(x: u32) => x,
}; Finally, Either values can be matched. Again, variables that are introduced in match arms must be explicitly typed. let map_either: u32 = match Left(1337) { Left(x: u32) => f(x), Right(y: u32) => f(y),
}; Match expressions don't support further pattern matching, in contrast to Rust. let unwrap_or_default: u32 = match Some((4, 2)) { None => 0, // this doesn't compile Some((y, z): (u16, u16)) => <(u16, u16)>::into((y, z)),
}; However, the match arm can contain code that performs the deconstruction. For example, the tuple x of type (u16, u16) can be deconstructed into two integers y and z of type u16. let unwrap_or_default: u32 = match Some((4, 2)) { None => 0, Some(x: (u16, u16)) => { let (y, z): (u16, u16) = x; <(u16, u16)>::into((y, z)) }
}; The match arm can also contain match expressions for further deconstruction. For example, the sum value x of type Either<u32, u32> can be matched as either Left(y: u32) or Right(z: u32). let unwrap_or_default: u32 = match Some(Left(42)) { None => 0, Some(x: Either<u32, u32>) => match x { Left(y: u32) => y, Right(z: u32) => z, },
};

