Simfony has no support for recursive function calls. A function can be called inside a function body if it has been defined before. This means that a function cannot call itself. Loops, where f calls g and g calls f, are also impossible. What is possible are stratified function definitions, where level-0 functions depend on nothing, level-1 functions depend on level-0 functions, and so on. fn level_0() -> u32 { 0
} fn level_1() -> u32 { let (_, next) = jet::increment_32(level_0()); next
} fn level_2() -> u32 { let (_, next) = jet::increment_32(level_1)); next
}

