A Simfony program consists of a main function . A program may also have type aliases or custom function definitions . The main function comes last in the program, because everything it calls must be defined before it. type Furlong = u32;
type Mile = u32; fn to_miles(distance: Either<Furlong, Mile>) -> Mile { match distance { Left(furlongs: Furlong) => jet::divide_32(furlongs, 8), Right(miles: Mile) => miles, }
} fn main() { let eight_furlongs: Either<Furlong, Mile> = Left(8); let one_mile: Either<Furlong, Mile> = Right(1); assert!(jet::eq_32(1, to_miles(eight_furlongs))); assert!(jet::eq_32(1, to_miles(one_mile)));
}
